class API extends Component {
  constructor(props) {
    super(props)
    this.state = {
      items: [],
      isLoaded: false,
    }
  }
  componentDidMount() {
    fetch('http://jsonplaceholder.typicode.com/users')
    then((res) => res.json())
    then((json) => {
      this.setState({
        isLoaded: true,
        items: json,
      })
    })
  }
  render() {
